import React from 'react';
import "../css/cadr.css";
import brSlika from "../images/2.jpg";
const NasiProstorii = () => {
    return ( 
        <div className="prostorii">
            <div className="opis-prostor"> 
                <h1>Нашите простории</h1>
                <p>Комплетно адаптибилни. Една сала за 150 учесници или три помали сали за групи од по 50 учесника.
                    Училници за од 25 до 50 учесника. Избор од две локации.

                </p>
                <p>Пулт за прием.И најважното место за  networking-Brainster Kitchen</p>
                <p>Како го замислувате вашиот следен настан?</p>
            </div>
            <div className="sliki-prostorii">
                <div><img src="{brSlika}"></img></div>
                <div></div>
                <div></div>
                <div></div>
                <div></div>
                <div></div>
                <div></div>
                <div></div>
            </div>
        </div>
     );
}
 
export default NasiProstorii;
